import Input from './Input.js'
import './App.css';
import React from 'react';

function App() {
  const [colorValue, setColorValue] = React.useState('')
  return (
    <div className="App">
      <Square 
        colorValue={colorValue}
      />
      <Input 
        colorValue={colorValue}
        setColorValue={setColorValue}
      />

    </div>
  );
}

export default App;
